import CustomNav from "../customNav/CustomNav";
import "./Menu.css";
import React, { useEffect, useState } from 'react';


function Menu() {

  const [filmData, setFilmData] = useState([]);

  useEffect(() => {
    fetch('https://gist.githubusercontent.com/saniyusuf/406b843afdfb9c6a86e25753fe2761f4/raw/523c324c7fcc36efab8224f9ebb7556c09b69a14/Film.JSON')
      .then(response => response.json())
      .then(data => setFilmData(data))
      .catch(error => console.log(error));
  }, []);


  return (
    <div className="text-white">

      <CustomNav />

      <h1>Menu</h1>
      <p>Bienvenido al panel de control después de iniciar sesión.</p>
      {filmData.map(film => (
        <div key={film.imdbID}>
          <h3>{film}</h3>
        </div>
      ))}
    </div>
  );
}

export default Menu;
